import React from "react";
// import "./Header.css";
import { Stack, Button } from "@mui/material";

class Header extends React.Component {
  render() {
    return (
      <Stack>
        <Button color="error">Button1</Button>
        <Button color="info">Button1</Button>
      </Stack>
    );
  }
}

export default Header;
